import React from "react";
import styled from "styled-components";

const AppMain = styled.main`
  margin-top: 56px;
  overflow: auto;
  height: calc(100% - 56px);
`;

export const Main = ({ children }) => {
  return <AppMain>{children}</AppMain>;
};
